-- Crear base de datos y usarla
CREATE DATABASE IF NOT EXISTS discos;
USE discos;

-- Crear tabla discos_mas_vendidos
CREATE TABLE discos_mas_vendidos (
    id INT(3) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    titulo VARCHAR(255),
    autor VARCHAR(255),
    anyo INT,
    ventas VARCHAR(50),
    imagen LONGTEXT
);

